export default {
   name: 'AView',
   data() {
      return {
         loading: true,
         loadedData: Object,
      }
   },
   created() {
      this.loadData();
   },
   methods: {
      async loadData() {
         const response = await SomeAPIService.request();
         if(response.status === 200) {
            this.loadedData.title = response.title;
            this.loadedData.content = response.content;
            this.loading = false;
         }
      }
   }
}
